column5:
Improved live_reload, guarding against multiple rapid reloads, issue #487
Added API so application has some control over the process.

API use
//after	ss.client.packAssets();

ss.client.set({
  onChange:
  { DelayTime:500,
    GuardTime:4000,
    Validate:function(path, event,action){ //needs fn wrapped else it does not add it to options
    console.log('onChangeValidate :', path);
    return true;
    },
    Publish:function(path, event,action,pubs){ //needs fn wrapped else it does not add it to options
    console.log('onChange.Publish :', action);
    //modify pubs if needed return null to not send any pubs
    return pubs;
    }
  }});

Conflicts:
	lib/client/live_reload.js

